{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/gabrielbaltazar/bellabeat-case-study-using-r?scriptVersionId=190280552\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"39a4cad9","metadata":{"papermill":{"duration":0.009856,"end_time":"2024-07-29T10:58:24.662048","exception":false,"start_time":"2024-07-29T10:58:24.652192","status":"completed"},"tags":[]},"source":["# Bellabeat Case Study using R\n","\n","\n","---\n","*This case study was done as part of the Google Data Analytics Certificate. It was my first experience completing an end-to-end data analytics project using of R. Constructive feedbacks are more than welcome!*\n","___\n","\n","## Scenario\n","\n","Bellabeat is a company that makes health-focused products for women. Urška Sršen, the Co-founder and Chief Creative Officer, believes analyzing consumer data could uncover growth opportunities. As a data analyst on the marketing team, I have been asked to analyze smart device usage data to understand how consumers use non-Bellabeat devices. The goal is to identify current usage patterns and provide recommendations to enhance Bellabeat’s marketing strategy.\n","\n","The analysis will focus on the following questions:\n","\n","1. What are some trends in smart device usage?\n","2. How could these trends apply to Bellabeat customers?\n","3. How could these trends help influence Bellabeat's marketing strategy?\n","\n","For the analysis Sršen encourages to use public data that explores smart device users’ daily habits. She specifically points to Fitbit smart device data, which is available on [this kaggle link](https://www.kaggle.com/datasets/arashnic/fitbit). \n","\n","\n","### Business Task\n","\n","Identify trends in smart device usage data and use it to guide and shape Bellabeat's marketing strategy, foreseeing opportunities that can be applied to Bellabeat customers.\n","\n","\n","## Coding\n","\n","First we load some packages:\n"]},{"cell_type":"code","execution_count":1,"id":"87ad7ccc","metadata":{"execution":{"iopub.execute_input":"2024-07-29T10:58:24.685741Z","iopub.status.busy":"2024-07-29T10:58:24.683126Z","iopub.status.idle":"2024-07-29T10:58:25.932701Z","shell.execute_reply":"2024-07-29T10:58:25.930761Z"},"papermill":{"duration":1.264579,"end_time":"2024-07-29T10:58:25.935591","exception":false,"start_time":"2024-07-29T10:58:24.671012","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.1\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.4     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.3     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.2     \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\u001b[36mℹ\u001b[39m Use the conflicted package (\u001b[3m\u001b[34m<http://conflicted.r-lib.org/>\u001b[39m\u001b[23m) to force all conflicts to become errors\n"]}],"source":["library(tidyverse)\n","library(lubridate)\n","library(dplyr)\n","library(ggplot2)\n","library(tidyr)\n","library(readr)"]},{"cell_type":"markdown","id":"55295b36","metadata":{"papermill":{"duration"