son's product-moment correlation\n","\n","data:  df$SedentaryMinutes and df$TotalTimeInBed\n","t = -15.966, df = 411, p-value < 2.2e-16\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," -0.6749140 -0.5553762\n","sample estimates:\n","       cor \n","-0.6187135 \n"]},"metadata":{},"output_type":"display_data"}],"source":["cor.test(df$SedentaryMinutes, df$TotalTimeInBed, method = 'pearson', conf.level = 0.95)"]},{"cell_type":"markdown","id":"71374d92","metadata":{"_kg_hide-output":true,"papermill":{"duration":0.016045,"end_time":"2024-07-29T10:58:30.152099","exception":false,"start_time":"2024-07-29T10:58:30.136054","status":"completed"},"tags":[]},"source":["As we can see, the correlation with a confidence level of 95% is -0.6, which means that there is a very weak relationship between sedentary minutes and total time in bed. Therefore the data shows us that the more minutes users spend in sedentary activity, the fewer minutes they are likely to spend in bed.\n","\n","I came across [research by Catrine Tudor-Locke and David R Bassett Jr](https://ijbnpa.biomedcentral.com/articles/10.1186/1479-5868-8-80#) on how many steps per day an adult should walk, where they categorized five ranges of steps taken into different lifestyle categories:\n","\n"," * Sedentary < 5000 steps a day\n"," * Low-active 5000 - 7499 steps\n"," * Somewhat active 7500 - 9999\n"," * Active 10000 - 12499\n"," * Highly active ≥ 12500 steps\n","\n","Based on that I decided to categorise Fitbit users the same way, and show it in graphs: \n"]},{"cell_type":"code","execution_count":14,"id":"04e3eec6","metadata":{"execution":{"iopub.execute_input":"2024-07-29T10:58:30.189149Z","iopub.status.busy":"2024-07-29T10:58:30.187397Z","iopub.status.idle":"2024-07-29T10:58:30.218612Z","shell.execute_reply":"2024-07-29T10:58:30.216626Z"},"papermill":{"duration":0.053918,"end_time":"2024-07-29T10:58:30.222254","exception":false,"start_time":"2024-07-29T10:58:30.168336","status":"completed"},"tags":[]},"outputs":[],"source":["# Create a new data frame to find mean of total steps per user\n","df_ts_mean <- df %>% group_by(Id) %>% summarise(TotalSteps = mean(TotalSteps))"]},{"cell_type":"code","execution_count":15,"id":"c20bef68","metadata":{"execution":{"iopub.execute_input":"2024-07-29T10:58:30.259319Z","iopub.status.busy":"2024-07-29T10:58:30.257507Z","iopub.status.idle":"2024-07-29T10:58:30.300787Z","shell.execute_reply":"2024-07-29T10:58:30.298247Z"},"papermill":{"duration":0.065594,"end_time":"2024-07-29T10:58:30.304107","exception":false,"start_time":"2024-07-29T10:58:30.238513","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["Number of rows:  33 \n","Number of columns:  3"]},{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>Id</th><th scope=col>TotalSteps</th><th scope=col>category</th></tr>\n","\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;fct&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>1503960366</td><td>12116.742</td><td>Active    </td></tr>\n","\t<tr><td>1624580081</td><td> 5743.903</td><td>Low Active</td></tr>\n","\t<tr><td>1644430081</td><td> 7282.967</td><td>Low Active</td></tr>\n","\t<tr><td>1844505072</td><td> 2580.065</td><td>Sedentary </td></tr>\n","\t<tr><td>1927972279</td><td>  916.129</td><td>Sedentary </td></tr>\n","\t<tr><td>2022484408</td><td>11370.645</td><td>Active    </td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A tibble: 6 × 3\n","\\begin{tabular}{lll}\n"," Id & TotalSteps & category\\\\\n"," <dbl> & <dbl> & <fct>\\\\\n","\\hline\n","\t 1503960366 & 12116.742 & Active    \\\\\n","\t 1624580081 &  5743.903 & Low Active\\\\\n","\t 1644430081 &  7282.967 & Low Active\\\\\n","\t 1844505072 &  2580.065 & Sedentary \\\\\n","\t 1927972279 &   916.129 & Sedentary \\\\\n","\t 2022484408 & 11370.645 & Active    \\\\\n","\\end{tabular}