4","status":"completed"},"tags":[]},"source":["## Conclusion\n","\n","The Fitbit data provided does not specify the gender of users. As Bellabeat focuses on women, this could reveal different habits and behaviors compared to a mixed-gender user base.\n","\n","Bellabeat’s marketing should concentrate on women with active lifestyles and those aspiring to become more active, rather than targeting highly active users. Fitbit, being an entry-level market device, does not attract as many highly active users. Individuals aiming for high-performance activities tend to prefer devices with higher precision, such as Garmin devices.\n","\n","All user profiles indicate a tendency to increase their activity levels before 9 AM, around lunchtime, and in the early evening. This suggests they likely work regular 9 to 5 jobs.\n","\n","Bellabeat’s product could recommend higher activity goals at specific times of the day when users are more inclined to exercise. Additionally, depending on their profile, the product could occasionally suggest low-intensity activities, such as a walk, during times when users are less likely to be active.\n","\n","Moreover, Bellabeat could assist users in establishing a consistent bedtime routine. Regular sleep patterns can improve sleep quality, ensure adequate rest, and promote higher activity levels.\n","\n","___\n","\n","Thank you for your interest in my Bellabeat Case Study."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":5353842,"sourceId":8904922,"sourceType":"datasetVersion"}],"dockerImageVersionId":30618,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":11.987421,"end_time":"2024-07-29T10:58:32.867331","environment_variables":{},"exception